To prevent concurrent problems with read/write files try flock utility. # lefthook.yml graphql-schema: glob: "{Gemfile.lock,app/graphql/**/*}" run: flock webpack/application/typings/graphql-schema.json yarn typings:update && git diff --exit-code --stat HEAD webpack/application/typings
frontend-tests: glob: "**/*.js" run: flock -s webpack/application/typings/graphql-schema.json yarn test --findRelatedTests {files}
frontend-typings: glob: "**/*.js" run: flock -s webpack/application/typings/graphql-schema.json yarn run flow focus-check {files}
